import { useState, useEffect } from 'react';
import axios from 'axios';

const Vid_list = () => {
    const [latest_list, setLatestList] = useState([]);

    const fetchList = async () => {
        try {
            const response = await axios.get('http://localhost:8000/api/videos');
            setLatestList(response.data);
        } catch (error) {
            console.error("Error fetching video list:", error);
        }
    };

    // Fetch the list when the component mounts
    useEffect(() => {
        fetchList();
    }, []);

    return (
        <div className="list_view">
            {latest_list.map((video, index) => (
                <div key={index} className="Card">
                    <div className="thumbnail_block">
                        <img src={video.thumbnail} alt="thumbnail" className="thumbnail" />
                    </div>
                    <div className="video-info">
                        <h4 id="recom_vid_title">{video.title}</h4>
                        <p id="uploader">{video.uploader}</p>
                        <p>Upload - {video.time}</p>
                    </div>
                </div>
            ))}
        </div>
    );
};

export default Vid_list;
